import React from 'react';
import cl from './Header.module.css';

const Header = () => {
    return (
        <header className={cl.header}>
            <img src="https://www.freelogodesign.org/Content/img/logo-ex-7.png" alt="logo"/>
        </header>
    );
}

export default Header;
